import React from 'react'
import { Layout } from 'antd';

const { Header, Footer, Content } = Layout;
const Login = () => {
    return (
        <React.Fragment>
            <Layout style={{ height: '100%' }}>
                <Header style={{textAlign:'center'}}>
                    登陆界面
                </Header>
                <Content style={{margin:'auto',marginTop:'200px'}}>Content</Content>
                <Footer style={{background:'#041527'}}>Footer</Footer>
            </Layout>
        </React.Fragment>
    )
}

export default Login
